#graphql

fragment VaultFields on Vault {
  debtToken
  debtSymbol
  collateralToken
  collateralSymbol
  vaultId
  leverageTier
  totalTea
  totalValue
  lockedLiquidity
  apeAddress
  apeCollateral
  teaCollateral
}

query VaultQuery {
  vaults {
    ...VaultFields
  }
}

