query getUserTeaPositions($user: Bytes) {
  userPositionTeas(where: { user: $user }) {
    user
    vaultId
    balance
    teaDecimals
    debtToken
    debtSymbol
    collateralToken
    collateralSymbol
    leverageTier
  }
}
